A sculptural composition of bold color and intricate detail🔹🦚 this earring is anchored by a large faceted lapis teardrop, set with a turquoise cabochon surrounded by diamonds. 

The top is a quatrefoil motif, inlaid with tsavorites and another turquoise stone at the center, giving the piece both symmetry and softness. It’s a striking yet refined design that plays with scale, texture, and the natural brilliance of the stones.

